package cn.jzteam.core.jvm.memery;

public class ConstantPoolTest {

    private static String largeStr1 = "data:image/jpeg;base64,";


    public static void main(String[] args) {
        // 看这种大字符串在class文件常量池、运行时常量池、字符串常量池
        System.out.println("线程开启,20秒准备");
        try {
            Thread.sleep( 10 * 1000);

            int count = 10000;
            while (count-- > 0){

                final String s = new String(largeStr1 + count);
                s.intern();
                System.out.println("intern一个字符串常量"+count);
                Thread.sleep( 10);

            }




        } catch (InterruptedException e) {
            e.printStackTrace();
        }
        System.out.println("线程结束");
    }

}
